// Make a predictable pseudorandom number generator based on ppt and session id
var rng = new Math.seedrandom(this.options.ppt + '/' + this.options.session);
var orderNum = Math.trunc(rng() * 1000);

// Use a specific ordering file based on that number
const response = await fetch(this.files['order' + orderNum + '.json'])
this.options.templateParameters = await response.json()
